"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[46139],{23905:(e,t,n)=>{n.r(t),n.d(t,{data:()=>a});const a={key:"v-52bd9a62",path:"/gazette/1900/19000106-government-notification-no-1.html",title:"Government Notification. - No. 2.",lang:"zh-Hant",frontmatter:{lang:"zh-Hant",title:"Government Notification. - No. 2.",description:"香港有古考！"},excerpt:"",headers:[],filePathRelative:"gazette/1900/19000106-government-notification-no-1.md",git:{updatedTime:1629116247e3}}},91596:(e,t,n)=>{n.r(t),n.d(t,{default:()=>o});const a=(0,n(66252).uE)('<h1 id="government-notification-no-2" tabindex="-1"><a class="header-anchor" href="#government-notification-no-2" aria-hidden="true">#</a> Government Notification. - No. 2.</h1><p>The following Notice is published.</p><p>By Command,</p><p>J. H. STEWART LOCKHART.<br> Colonial Secretary</p><p>Colonial Secretary&#39;s Office, Hongkong, 6th January, 1990.</p><hr><p>NOTICE.</p><p>In accordance with the terms of the Rating Ordinance, No. 15 of 1888. Owners and Occupiers of Tenements are reminded that Rats for the First Quarter of 1900 are payable in advance on or before the 31st January, 1900.</p><p>If any person shall fail to pay such Rates on or before the 28th February, 1900, proceedings will be taken in the Supreme Court for their recovery without futher notice.</p><p>No refund of Rates on vacant tenements will be granted unless such rates have been paid during and whith the month of January.</p><p>A. M. THOMSON,<br><em>Treasurer</em></p><p>Treasury, Hongkong, 3rd January, 1900.</p>',12),o={render:function(e,t){return a}}}}]);